export default async function get() {
  const url =
    "https://vkyh3862ql.execute-api.ap-southeast-1.amazonaws.com/post-http";
  try {
    const response = await fetch(url);
    return await response.text();
    // return await response.json();
  } catch (error) {
    console.log(error);
  }
}
